                </div>
                <Iframe url="https://www.google.com/maps/d/u/0/embed?mid=1LAvNUDdCf-hMVCYIKfhqliPEjO1GTqza&ll=39.9526, -75.1652" 
                width="1920px"
                height="700px"
                id="myId"
                className=""
                // display="initial"

                // position="relative"
                />

            </div>
        )
    }

export default iframe;
